// Les Datas pour le Widget Chart 
// Pour l'instant Random
const data_Chart = [
  {
    name: 'Page A', uv: 4000, pv: 2400, 
  },
  {
    name: 'Page B', uv: 3000, pv: 1398, 
  },
  {
    name: 'Page C', uv: 2000, pv: 9800, 
  },
  {
    name: 'Page D', uv: 2780, pv: 3908,
  }
]
export default data_Chart
